(123, 6, 'Sales', 'Inside Sales Representative', 'Entry-Level/Junior', 'Focus on selling products or services remotely, typically over the phone or through online channels. They proactively reach out to prospects, conduct sales presentations, negotiate terms, and close deals to meet sales targets.'),
(124, 6, 'Sales', 'Account Executive', 'Mid-Level/Intermediate', 'Manage relationships with existing clients and pursue new business opportunities. They identify client needs, propose solutions, negotiate contracts, and close sales to drive revenue growth and customer satisfaction.'),
(125, 6, 'Sales', 'Sales Representative', 'Mid-Level/Intermediate', 'Promote and sell products or services to prospective customers. They identify leads, conduct sales presentations, address customer concerns, negotiate terms, and close deals to achieve sales targets and revenue goals.'),
(126, 6, 'Sales', 'Business Development Manager', 'Mid-Level/Intermediate', 'Focus on identifying new business opportunities and expanding the customer base. They research market trends, identify potential clients, develop sales strategies, and build relationships with key stakeholders to drive business growth.'),
(127, 6, 'Sales', 'Territory Sales Manager', 'Mid-Level/Intermediate', 'Oversee sales activities within a specific geographic region or territory. They develop sales plans, set targets, manage sales representatives, and establish relationships with customers and distributors to drive sales performance and achieve revenue goals.'),
(128, 6, 'Sales', 'Sales Engineer', 'Mid-Level/Intermediate', 'Provide technical expertise and support to the sales team and customers. They assist in product demonstrations, explain technical features and benefits, address customer concerns, and provide pre-sales and post-sales support to ensure customer satisfaction.'),
(129, 6, 'Sales', 'Channel Sales Manager', 'Mid-Level/Intermediate', 'Manage relationships with channel partners, such as distributors, resellers, and retailers.'),
(130, 6, 'Sales', 'Sales Manager', 'Senior Level', 'Oversee the sales team and are responsible for achieving sales targets and objectives.'),
(131, 6, 'Sales', 'Regional Sales Manager', 'Senior Level', 'Oversee sales activities within a specific region or territory.'),
(132, 6, 'Sales', 'Key Account Manager', 'Senior Level', 'Focus on managing relationships with strategic accounts and maximizing customer value and satisfaction.'),
(133, 6, 'Sales', 'Senior Account Executive', 'Senior Level', 'Manage complex sales opportunities and strategic accounts. They develop and execute sales strategies, build relationships with key stakeholders, negotiate contracts, and drive revenue growth and customer retention.'),
(134, 6, 'Sales', 'Sales Operations Manager', 'Senior Level', 'Oversee the operational and administrative functions of the sales department. They manage sales processes, optimize sales workflows, analyze sales data, implement sales technologies, and provide support to sales representatives to improve efficiency and effectiveness.'),
(135, 6, 'Sales', 'Sales Trainer', 'Senior Level', 'Develop and deliver training programs to the sales team to enhance selling skills, product knowledge, and sales techniques.'),
(136, 6, 'Sales', 'Vice President of Sales', 'Executive/Leadership Level', 'Provides strategic leadership and direction for the sales department. They develop sales strategies, set sales goals, manage sales teams, and collaborate with other executives to align sales initiatives with overall business objectives and drive revenue growth.'),
(137, 6, 'Sales', 'Director of Sales', 'Executive/Leadership Level', 'Oversees the sales operations and strategy for the organization. They develop and implement sales plans, set sales targets, monitor sales performance, and provide guidance and support to sales managers and representatives to achieve sales objectives.'),
(138, 6, 'Sales', 'Chief Sales Officer (CSO)', 'Executive/Leadership Level', 'Top executive responsible for leading the sales function within the organization. They develop sales strategies, set sales targets, manage sales teams, and drive revenue growth and customer acquisition to achieve organizational goals and objectives.');

